  "paths": {
    "/create-connector-profile": {
      "post": {
        "operationId": "CreateConnectorProfile",
        "description": " Creates a new connector profile associated with your AWS account. There is a soft quota of 100 connector profiles per AWS account. If you need more connector profiles than this quota allows, you can submit a request to the Amazon AppFlow team through the Amazon AppFlow support channel. ",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/CreateConnectorProfileResponse"
                }
              }
            }
          },
          "480": {
            "description": "ValidationException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/ValidationException" }
              }
            }
          },
          "481": {
            "description": "ConflictException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/ConflictException" }
              }
            }
          },
          "482": {
            "description": "ServiceQuotaExceededException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ServiceQuotaExceededException"
                }
              }
            }
          },
          "483": {
            "description": "ConnectorAuthenticationException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ConnectorAuthenticationException"
                }
              }
            }
          },
          "484": {
            "description": "InternalServerException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalServerException"
                }
              }
            }
          }
        },
        "parameters": [],
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "required": [
                  "connectorProfileName",
                  "connectorType",
                  "connectionMode",
                  "connectorProfileConfig"
                ],
                "properties": {
                  "connectorProfileName": {
                    "description": " The name of the connector profile. The name is unique for each <code>ConnectorProfile</code> in your AWS account. ",
                    "type": "string",
                    "pattern": "[\\w/!@#+=.-]+",
                    "maxLength": 256
                  },
                  "kmsArn": {
                    "description": " The ARN (Amazon Resource Name) of the Key Management Service (KMS) key you provide for encryption. This is required if you do not want to use the Amazon AppFlow-managed KMS key. If you don't provide anything here, Amazon AppFlow uses the Amazon AppFlow-managed KMS key. ",
                    "type": "string",
                    "pattern": "arn:aws:kms:.*:[0-9]+:.*",
                    "minLength": 20,
                    "maxLength": 2048
                  },
                  "connectorType": {
                    "description": " The type of connector, such as Salesforce, Amplitude, and so on. ",
                    "type": "string",
                    "enum": [
                      "Salesforce",
                      "Singular",
                      "Slack",
                      "Redshift",
                      "S3",
                      "Marketo",
                      "Googleanalytics",
                      "Zendesk",
                      "Servicenow",
                      "Datadog",
                      "Trendmicro",
                      "Snowflake",
                      "Dynatrace",
                      "Infornexus",
                      "Amplitude",
                      "Veeva",
                      "EventBridge",
                      "Upsolver",
                      "Upsolver",
                      "Honeycode",
                      "CustomerProfiles",
                      "SAPOData"
                    ]
                  },
                  "connectionMode": {
                    "description": " Indicates the connection mode and specifies whether it is public or private. Private flows use AWS PrivateLink to route data over AWS infrastructure without exposing it to the public internet. ",
                    "type": "string",
                    "enum": ["Public", "Private"]
                  },
                  "connectorProfileConfig": {
                    "description": " Defines the connector-specific configuration and credentials for the connector profile. ",
                    "type": "object",
                    "properties": {
                      "connectorProfileProperties": {
                        "allOf": [
                          {
                            "$ref": "#/components/schemas/ConnectorProfileProperties"
                          },
                          {
                            "description": " The connector-specific properties of the profile configuration. "
                          }
                        ]
                      },
                      "connectorProfileCredentials": {
                        "allOf": [
                          {
                            "$ref": "#/components/schemas/ConnectorProfileCredentials"
                          },
                          {
                            "description": " The connector-specific credentials required by each connector. "
                          }
                        ]
                      }
                    }
                  }
                }
              }
            }
          }
        },
        "summary": "Create Connector Profile"
      },
      "parameters": [
        { "$ref": "#/components/parameters/X-Amz-Content-Sha256" },
        { "$ref": "#/components/parameters/X-Amz-Date" },
        { "$ref": "#/components/parameters/X-Amz-Algorithm" },
        { "$ref": "#/components/parameters/X-Amz-Credential" },
        { "$ref": "#/components/parameters/X-Amz-Security-Token" },
        { "$ref": "#/components/parameters/X-Amz-Signature" },
        { "$ref": "#/components/parameters/X-Amz-SignedHeaders" }
      ]
    },
    "/create-flow": {
      "post": {
        "operationId": "CreateFlow",
        "description": " Enables your application to create a new flow using Amazon AppFlow. You must create a connector profile before calling this API. Please note that the Request Syntax below shows syntax for multiple destinations, however, you can only transfer data to one item in this list at a time. Amazon AppFlow does not currently support flows to multiple destinations at once. ",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/CreateFlowResponse" }
              }
            }
          },
          "480": {
            "description": "ValidationException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/ValidationException" }
              }
            }
          },
          "481": {
            "description": "InternalServerException",
            "content": {
              "application/json": {
